  #define COMPONENT_COUNT_OFFSET 0x4e4    // 组件计数偏移量
  #define COMPONENT_CAPACITY_OFFSET 0x4e8  // 组件容量偏移量
  #define COMPONENT_ACTIVE_OFFSET 0x4e0    // 组件活跃数偏移量
  
